static bool read_TerrainPatch(Buffer* buffer, STI_TypeLibrary* lib, TerrainPatch* out) {
    if (!read_TerrainMesh(buffer, lib, &out->TerrainMesh)) return false;
    if (!read_DynamicArray_TerrainPrimitive(buffer, lib, &out->TerrainPrimitive)) return false;
    if (!read_TerrainTexture(buffer, lib, &out->TerrainDisplacementTexture)) return false;
    if (!read_TerrainTexture(buffer, lib, &out->TerrainNormalTexture)) return false;
    if (!read_TerrainTexture(buffer, lib, &out->TerrainTriangleMapTexture)) return false;
    if (!read_TerrainTexture(buffer, lib, &out->TerrainMaterialDuplexTexture)) return false;
    if (!read_TerrainTexture(buffer, lib, &out->TerrainColorTexture)) return false;
    if (!read_TerrainTexture(buffer, lib, &out->TerrainQualityTexture)) return false;
    if (!read_TerrainTexture(buffer, lib, &out->TerrainIndirectionTexture)) return false;
    if (!read_TerrainTexture(buffer, lib, &out->TerrainSSDFAtlas)) return false;
{
        uint32 bitfield_value = 0;
        if (!read_STI_uint32(buffer, lib, &bitfield_value)) return false;
        out->DisplacementDownsampled = (bitfield_value >> 0) & 0x1;
}
    buffer->skip(buffer, 4);
    return true;
}
static void free_TerrainPatch(TerrainPatch* obj, STI_TypeLibrary* lib) {
    free_TerrainMesh(&obj->TerrainMesh, lib);
    free_DynamicArray_TerrainPrimitive(&obj->TerrainPrimitive, lib);
    free_TerrainTexture(&obj->TerrainDisplacementTexture, lib);
    free_TerrainTexture(&obj->TerrainNormalTexture, lib);
    free_TerrainTexture(&obj->TerrainTriangleMapTexture, lib);
    free_TerrainTexture(&obj->TerrainMaterialDuplexTexture, lib);
    free_TerrainTexture(&obj->TerrainColorTexture, lib);
    free_TerrainTexture(&obj->TerrainQualityTexture, lib);
    free_TerrainTexture(&obj->TerrainIndirectionTexture, lib);
    free_TerrainTexture(&obj->TerrainSSDFAtlas, lib);
}
