static bool read_DynamicArray_BuildData(Buffer* buffer, STI_TypeLibrary* lib, DynamicArray_BuildData* out) {
    uint32 count = 0;
    uint32 unk0 = 0;
    uint32 offset = 0;
    uint32 unk1 = 0;
    if (!read_STI_uint32(buffer, lib, &offset)) return false;
    if (!read_STI_uint32(buffer, lib, &unk0)) return false;
    if (!read_STI_uint32(buffer, lib, &count)) return false;
    if (!read_STI_uint32(buffer, lib, &unk1)) return false;
    DA_init(out, BuildData, count);
    if (count>0) {
        int64 original_offset = 0;
        if(buffer->get_position(buffer, &original_offset)!=BUFFER_SUCCESS) return false;
        if(buffer->set_position(buffer, offset, BUFFER_ORIGIN_START)!=BUFFER_SUCCESS) return false;
        for (uint32 i = 0; i < count; ++i) {
            if (!read_BuildData(buffer, lib, &out->items[i])) return false;
        }
        out->count = count;
        if(buffer->set_position(buffer, original_offset, BUFFER_ORIGIN_START)!=BUFFER_SUCCESS) return false;
    }
    return true;
}
static void free_DynamicArray_BuildData(DynamicArray_BuildData* obj, STI_TypeLibrary* lib) {
    for (uint32 i = 0; i < obj->count; ++i) {
        free_BuildData(&obj->items[i], lib);
    }
    DA_free(obj);
}
static void print_DynamicArray_BuildData(const DynamicArray_BuildData* obj, STI_TypeLibrary* lib, FILE* handle, uint32 indent) {
    fprintf(handle, "DynamicArray_BuildData {\n");
    indent++;
    if (obj->count>50) {
        fprintf(handle, "%*s", indent * 4, "");
        print_BuildData(&obj->items[0], lib, handle, indent + 1);
        fprintf(handle, "\n%*s...\n%*s", indent * 4, "", indent * 4, "");
        print_BuildData(&obj->items[obj->count-1], lib, handle, indent+1);
        fprintf(handle, "\n");
    } else {
        fprintf(handle, "%*s", indent*4, "");
        for (uint32 i = 0; i < obj->count; ++i) {
            print_BuildData(&obj->items[i], lib, handle, indent+1);
            if(i < obj->count-1){
                fprintf(handle,", \n%*s", indent*4, "");
            }
        }
        fprintf(handle, "\n");
    }
    fprintf(handle, "%*s}", (indent - 1) * 4, "");
}
