static bool read_CharacterSkinConstants(Buffer* buffer, STI_TypeLibrary* lib, CharacterSkinConstants* out) {
    for (uint32 i = 0; i < 2; ++i) {
        if (!read_STI_float32(buffer, lib, &out->DetailTilingFactorUV[i])) return false;
    }
    if (!read_STI_float32(buffer, lib, &out->DiffuseRoughness)) return false;
    if (!read_STI_float32(buffer, lib, &out->TransmissionModulator)) return false;
    if (!read_STI_float32(buffer, lib, &out->CameraStrength)) return false;
    if (!read_STI_float32(buffer, lib, &out->CameraSpecular)) return false;
    if (!read_STI_float32(buffer, lib, &out->DirtFactor)) return false;
    if (!read_STI_float32(buffer, lib, &out->FurLength)) return false;
    if (!read_STI_float32(buffer, lib, &out->FurThickness)) return false;
    if (!read_STI_float32(buffer, lib, &out->FurRoughness)) return false;
    if (!read_STI_float32(buffer, lib, &out->FurGravity)) return false;
    if (!read_STI_float32(buffer, lib, &out->FurSize)) return false;
{
        uint16 bitfield_value = 0;
        if (!read_STI_uint16(buffer, lib, &bitfield_value)) return false;
        out->DoubleSided = (bitfield_value >> 0) & 0x1;
        out->UseAlphaMask = (bitfield_value >> 1) & 0x1;
        out->UseFeatureTintMap = (bitfield_value >> 2) & 0x1;
        out->UseWrinkleMap = (bitfield_value >> 3) & 0x1;
        out->UseFur = (bitfield_value >> 4) & 0x1;
}
    buffer->skip(buffer, 2);
    return true;
}
