    buffer->skip(buffer, 1);
    if (!read_DynamicArray_OwnedEquipment2(buffer, lib, &out->Inventory)) return false;
    for (uint32 i = 0; i < 16; ++i) {
        if (!read_STI_uint32(buffer, lib, &out->PPInventorySlot[i])) return false;
    }
    if (!read_DynamicArray_VehicleData(buffer, lib, &out->VehicleData)) return false;
    if (!read_STI_uint8(buffer, lib, &out->VehiclePreferedCameraThirdPerson)) return false;
    buffer->skip(buffer, 7);
    if (!read_DynamicArray_STI_uint32(buffer, lib, &out->EmotesUnlocked)) return false;
    for (uint32 i = 0; i < 8; ++i) {
        if (!read_STI_uint32(buffer, lib, &out->EmoteSlots[i])) return false;
    }
    if (!read_DynamicArray_STI_uint64(buffer, lib, &out->Collectables)) return false;
    if (!read_STI_float32(buffer, lib, &out->DistanceTravelled)) return false;
    if (!read_STI_float32(buffer, lib, &out->TimeOfDay)) return false;
    if (!read_STI_float32(buffer, lib, &out->WeatherTime)) return false;
    buffer->skip(buffer, 4);
    if (!read_DynamicArray_PlayerPosition(buffer, lib, &out->PlayerPositions)) return false;
    if (!read_STI_uint64(buffer, lib, &out->LastLevelUpTS)) return false;
    if (!read_DynamicArray_STI_uint32(buffer, lib, &out->GivenDLCItems)) return false;
    if (!read_DynamicArray_RaidLootSaveData(buffer, lib, &out->RaidLootAcquired)) return false;
    if (!read_STI_uint32(buffer, lib, &out->ActiveTitle)) return false;
    buffer->skip(buffer, 4);
    return true;
