static bool read_ProfileSaveData7(Buffer* buffer, STI_TypeLibrary* lib, ProfileSaveData7* out) {
    if (!read_DynamicArray_STI_uint64(buffer, lib, &out->Collectables)) return false;
    if (!read_DynamicArray_STI_uint32(buffer, lib, &out->EmotesUnlocked)) return false;
    for (uint32 i = 0; i < 8; ++i) {
        if (!read_STI_uint32(buffer, lib, &out->EmoteSlots[i])) return false;
    }
    if (!read_STI_uint64(buffer, lib, &out->TrackingId)) return false;
    if (!read_DynamicArray_SettingNameValuePair(buffer, lib, &out->Settings)) return false;
    if (!read_DynamicArray_STI_uint32(buffer, lib, &out->CompletedBounties)) return false;
    if (!read_STI_int64(buffer, lib, &out->LastLogin)) return false;
{
        uint8 bitfield_value = 0;
        if (!read_STI_uint8(buffer, lib, &bitfield_value)) return false;
        out->SocialDisabled = (bitfield_value >> 0) & 0x1;
}
    if (!read_STI_uint8(buffer, lib, &out->VehiclePreferedCameraThirdPerson)) return false;
{
        uint8 bitfield_value = 0;
        if (!read_STI_uint8(buffer, lib, &bitfield_value)) return false;
        out->TrackingEnabled = (bitfield_value >> 0) & 0x1;
        out->ShownTrackingOptIn = (bitfield_value >> 1) & 0x1;
        out->CrashReportingEnabled = (bitfield_value >> 2) & 0x1;
        out->ShownCrashReportingEnabledOptIn = (bitfield_value >> 3) & 0x1;
        out->AcceptedEULA = (bitfield_value >> 4) & 0x1;
}
    for (uint32 i = 0; i < 64; ++i) {
        if (!read_STI_uint8(buffer, lib, &out->EULA_PP_HASH[i])) return false;
    }
    buffer->skip(buffer, 5);
    if (!read_DynamicArray_ResourceStorageItem(buffer, lib, &out->ResourceStorage)) return false;
    if (!read_DynamicArray_OwnedEquipment2(buffer, lib, &out->SafehouseStorage)) return false;
    if (!read_STI_uint32(buffer, lib, &out->FixVersion)) return false;
    buffer->skip(buffer, 4);
    return true;
}
