    if (!read_STI_uint8(buffer, lib, &out->ContextualHelpActive)) return false;
    buffer->skip(buffer, 7);
    if (!read_DynamicArray_LocationSummarySaveData(buffer, lib, &out->LocationSummaries)) return false;
    if (!read_DynamicArray_RaidSaveData2(buffer, lib, &out->Raids)) return false;
    if (!read_DynamicArray_TimerSaveData1(buffer, lib, &out->Timers)) return false;
    if (!read_DynamicArray_STI_uint64(buffer, lib, &out->PlayerSpawnPoints)) return false;
