static bool read_TerrainMaterial(Buffer* buffer, STI_TypeLibrary* lib, TerrainMaterial* out) {
    if (!read_StringHash_48c5294d_4(buffer, lib, &out->NameHash)) return false;
    if (!read_StringHash_48c5294d_4(buffer, lib, &out->VegetationSet)) return false;
    if (!read_StringHash_48c5294d_4(buffer, lib, &out->GameMaterial)) return false;
    if (!read_STI_uint8(buffer, lib, &out->TextureNearIndex)) return false;
    if (!read_STI_uint8(buffer, lib, &out->TextureMidIndex)) return false;
    buffer->skip(buffer, 2);
    if (!read_STI_float32(buffer, lib, &out->Transmissive)) return false;
    if (!read_STI_float32(buffer, lib, &out->ColorInfluence)) return false;
    for (uint32 i = 0; i < 3; ++i) {
        if (!read_STI_uint8(buffer, lib, &out->ColorNear[i])) return false;
    }
    for (uint32 i = 0; i < 3; ++i) {
        if (!read_STI_uint8(buffer, lib, &out->ColorMid[i])) return false;
    }
{
        uint8 bitfield_value = 0;
        if (!read_STI_uint8(buffer, lib, &bitfield_value)) return false;
        out->GroundHaze = (bitfield_value >> 0) & 0x1;
}
    buffer->skip(buffer, 1);
    if (!read_STI_float32(buffer, lib, &out->NormalDampening)) return false;
    if (!read_STI_float32(buffer, lib, &out->DisplacementScale)) return false;
    if (!read_STI_float32(buffer, lib, &out->DisplacementBias)) return false;
    if (!read_STI_uint8(buffer, lib, &out->DisplacementMip)) return false;
    buffer->skip(buffer, 3);
    if (!read_STI_float32(buffer, lib, &out->BlendScale)) return false;
    if (!read_STI_float32(buffer, lib, &out->BlendBias)) return false;
    return true;
}
